export const Wrapper = styled.div`
  height: 100%;
  background: rgba(0,0,0,0.0300);
  width: 50%;
  align-items: center;
  display: flex;
  justify-content: center;
`;

export const Content = styled.div`
  width: 100%;
  max-width: 315px;
